`,paraId:3,tocIndex:2}],fp={},vp={title:"\u9AD8\u9636api\u7528\u6CD5",toc:"content",filename:"docs/ts/ts-advance-api.md",lastUpdated:1709476867e3,nav:"Ts",group:"\u8FDB\u9636",mobile:!1,description:"\u5728\u4E00\u4E2A\u8054\u5408\u7C7B\u578B T \u4E2D\u6392\u9664\u8054\u5408\u7C7B\u578B U \u4E2D\u7684\u9879\uFF0C\u6E90\u7801\u5982\u4E0B\uFF1A"},mp=[{id:"\u9AD8\u9636-api-\u7528\u6CD5",depth:2,title:"\u9AD8\u9636 api \u7528\u6CD5"},{id:"record",depth:2,title:"Record"},{id:"returntype",depth:2,title:"ReturnType"},{id:"parameters",depth:2,title:"Parameters"},{id:"exclude",depth:2,title:"Exclude"},{id:"omit",depth:2,title:"Omit"},{id:"partical",depth:2,title:"Partical"},{id:"pick",depth:2,title:"Pick"}],hp=[{value:`/**
 * Record
 * Record<Keys\uFF0C Type>
 * \u6784\u9020\u4E00\u4E2A\u5BF9\u8C61\u7C7B\u578B\uFF0CKeys \u8868\u793A\u5BF9\u8C61\u7684\u5C5E\u6027\u952E \u3001Type \u8868\u793A\u5BF9\u8C61\u7684\u5C5E\u6027\u503C\uFF0C\u7528\u4E8E\u5C06\u4E00\u79CD\u7C7B\u578B\u5C5E\u6027\u6620\u5C04\u5230\u53E6\u4E00\u79CD\u7C7B\u578B
 */

type studentScore = { [name: string]: number };

type studentScore1 = Record<string, number>;

/**
 * Record \u7C7B\u578B\u4F7F\u7528\u573A\u666F
 * \u9650\u5236\u5C5E\u6027\u540D\u79F0
 */
type roles = 'tester' | 'developer' | 'manager';
const staffCount: Record<roles, number> = {
  tester: 10,
  developer: 20,
  manager: 1,
};

/**
 * Record\u7C7B\u578B \u548C keyof \u7EC4\u5408
 */

interface Staff {
  name: string;
  salary: number;
}

type StaffJson = Record<keyof Staff, string>;

const product: StaffJson = {
  name: 'John',
  salary: '3000',
};
