`,paraId:2,tocIndex:3},{value:"\u5728\u4E00\u4E2A\u8054\u5408\u7C7B\u578B T \u4E2D\u6392\u9664\u8054\u5408\u7C7B\u578B U \u4E2D\u7684\u9879\uFF0C\u6E90\u7801\u5982\u4E0B\uFF1A",paraId:3,tocIndex:4},{value:`/**
 * Exclude from T those types that are assignable to U
 */
// type Exclude<T, U> = T extends U ? never : T;

type T0 = Exclude<'a' | 'b' | 'c', 'a'>;
//   ^ = type T0 = "b" | "c"

type T1 = Exclude<'a' | 'b' | 'c', 'a' | 'b'>;
//   ^ = type T1 = "c"

type T2 = Exclude<string | number | (() => void), Function>;
//   ^ = type T2 = string | number
`,paraId:4,tocIndex:4},{value:"\u5728\u4E00\u4E2A\u7D22\u5F15\u7C7B\u578B T \u5185\u90E8\u6392\u9664\u7D22\u5F15\u6EE1\u8DB3 K \u7684\u9879\uFF1A",paraId:5,tocIndex:5},{value:`/**
 * Construct a type with the properties of T except for those in type K.
 */
// type Omit<T, K extends keyof any> = Pick<T, Exclude<keyof T, K>>;

interface Todo {
  title: string;
  description: string;
  completed: boolean;
}

type TodoPreview = Omit<Todo, 'description'>;

const todo: TodoPreview = {
  title: 'Clean room',
  completed: false,
};

type TodoInfo = Omit<Todo, 'completed' | 'title'>;
`,paraId:6,tocIndex:5},{value:"\u628A\u7D22\u5F15\u7C7B\u578B\u7684\u6240\u6709\u5C5E\u6027\u53D8\u6210\u53EF\u9009",paraId:7,tocIndex:6},{value:`/**
 * Make all properties in T optional
 */
type Partial<T> = {
  [P in keyof T]?: T[P];
};
